function CDOTABaseAbility:RollPRD(chance, key) --chance must be number between 0 and 100, 
	key = key or "PRDChance"
	self[key] = (self[key] or 0) + PRD.bakedC[tostring(chance)]
	local rv = RollPercentage(self[key] * 100)
	if rv then self[key] = 0 end
	return rv
end

CDOTA_Buff.RollPRD = CDOTABaseAbility.RollPRD
CDOTA_BaseNPC.RollPRD = CDOTABaseAbility.RollPRD

--everything below is useless and only used for baking stuff. full credit goes to Adam Smith https://gaming.stackexchange.com/questions/161430/calculating-the-constant-c-in-dota-2-pseudo-random-distribution

function PRD:BakePRD()
	print("{")
	print("\t[\"0\"] = 0,")
	for i=0.001,1,0.001 do
		self.bakedC[i] = self:CfromP(i)
		print("\t".."[\""..tostring(i * 100).."\"] = "..("%0.99f"):format(self.bakedC[i])..",")
	end
	print("\t[\"100\"] = 1,")
	print("}")
end

function PRD:CfromP( p )
    local Cupper = p
    local Clower = 0
    local Cmid
    local p1
    local p2 = 1
    while(true) do
        Cmid = ( Cupper + Clower ) / 2
        p1 = self:PfromC( Cmid )
        if ( math.abs( p1 - p2 ) <= 0 ) then break end

        if ( p1 > p ) then
            Cupper = Cmid
        elseif (p1 < p) then
            Clower = Cmid
        else
            return Cmid
        end

        p2 = p1
    end

    return Cmid
end

function PRD:PfromC( C )
    local pProcOnN = 0
    local pProcByN = 0
    local sumNpProcOnN = 0

    local maxFails = math.ceil( 1 / C )
    for N=1,maxFails do
        pProcOnN = math.min( 1, N * C ) * (1 - pProcByN)
        pProcByN = pProcByN + pProcOnN
        sumNpProcOnN = sumNpProcOnN + N * pProcOnN
    end

    return ( 1 / sumNpProcOnN )
end

